import React, { useState, useEffect, useCallback } from 'react';
import { useAuth } from '../contexts/AuthContext';

function AccessLogs() {
  const { token } = useAuth();
  const [logs, setLogs] = useState([]);
  const [loading, setLoading] = useState(true);
  const [filters, setFilters] = useState({
    search: '',
    accesstype: '',
    result: '',
    start_date: '',
    end_date: '',
    room_id: '',
    user_id: ''
  });
  const [pagination, setPagination] = useState({
    page: 1,
    limit: 25,
    total: 0,
    pages: 0
  });
  const [rooms, setRooms] = useState([]);
  const [users, setUsers] = useState([]);
  const [realTimeEnabled, setRealTimeEnabled] = useState(false);
  const [refreshInterval, setRefreshInterval] = useState(null);

  // Get access logs
  const fetchLogs = useCallback(async () => {
    try {
      setLoading(true);
      const queryParams = new URLSearchParams({
        page: pagination.page,
        limit: pagination.limit,
        ...Object.fromEntries(Object.entries(filters).filter(([_, value]) => value))
      });

      const response = await fetch(`/api/logs/access?${queryParams}`, {
        headers: { 'Authorization': `Bearer ${token}` }
      });
      
      if (response.ok) {
        const data = await response.json();
        setLogs(data.logs);
        setPagination(prev => ({ ...prev, ...data.pagination }));
      } else {
        console.error('Failed to fetch access logs');
        setLogs([]);
      }
    } catch (error) {
      console.error('Error fetching access logs:', error);
      setLogs([]);
    } finally {
      setLoading(false);
    }
  }, [token, filters, pagination.page, pagination.limit]);

  // Get rooms and users for filters
  const fetchFilterData = useCallback(async () => {
    try {
      const [roomsRes, usersRes] = await Promise.all([
        fetch('/api/rooms', { headers: { 'Authorization': `Bearer ${token}` } }),
        fetch('/api/users', { headers: { 'Authorization': `Bearer ${token}` } })
      ]);

      if (roomsRes.ok) {
        const roomsData = await roomsRes.json();
        setRooms(roomsData);
      }

      if (usersRes.ok) {
        const usersData = await usersRes.json();
        setUsers(usersData);
      }
    } catch (error) {
      console.error('Error fetching filter data:', error);
    }
  }, [token]);

  useEffect(() => {
    fetchFilterData();
  }, [fetchFilterData]);

  useEffect(() => {
    fetchLogs();
  }, [fetchLogs]);

  // Real-time monitoring
  useEffect(() => {
    if (realTimeEnabled) {
      const interval = setInterval(() => {
        if (pagination.page === 1) { // Only refresh if on first page
          fetchLogs();
        }
      }, 10000); // Refresh every 10 seconds
      setRefreshInterval(interval);
    } else {
      if (refreshInterval) {
        clearInterval(refreshInterval);
        setRefreshInterval(null);
      }
    }

    return () => {
      if (refreshInterval) {
        clearInterval(refreshInterval);
      }
    };
  }, [realTimeEnabled, fetchLogs, pagination.page, refreshInterval]);

  const handleFilterChange = (key, value) => {
    setFilters(prev => ({ ...prev, [key]: value }));
    setPagination(prev => ({ ...prev, page: 1 }));
  };

  const handlePageChange = (newPage) => {
    setPagination(prev => ({ ...prev, page: newPage }));
  };

  const clearFilters = () => {
    setFilters({
      search: '',
      accesstype: '',
      result: '',
      start_date: '',
      end_date: '',
      room_id: '',
      user_id: ''
    });
    setPagination(prev => ({ ...prev, page: 1 }));
  };

  const formatDateTime = (dateTime) => {
    if (!dateTime) return 'N/A';
    return new Date(dateTime).toLocaleString();
  };

  const getResultColor = (result) => {
    switch (result?.toLowerCase()) {
      case 'success': return 'bg-green-100 text-green-800';
      case 'failure': return 'bg-red-100 text-red-800';
      case 'denied': return 'bg-red-100 text-red-800';
      case 'warning': return 'bg-yellow-100 text-yellow-800';
      default: return 'bg-gray-100 text-gray-800';
    }
  };

  const getAccessTypeIcon = (type) => {
    switch (type?.toLowerCase()) {
      case 'entry': return 'ðŸšª';
      case 'exit': return 'ðŸšª';
      case 'door_unlock': return 'ðŸ”“';
      case 'door_lock': return 'ðŸ”’';
      case 'session_start': return 'â–¶ï¸';
      case 'session_end': return 'â¹ï¸';
      case 'emergency': return 'ðŸš¨';
      case 'maintenance': return 'ðŸ”§';
      case 'admin_override': return 'âš¡';
      default: return 'ðŸ”';
    }
  };

  const getAuthMethodIcon = (method) => {
    switch (method?.toLowerCase()) {
      case 'rfid': return 'ðŸ“±';
      case 'fingerprint': return 'ðŸ‘†';
      case 'pin': return 'ðŸ”¢';
      case 'manual': return 'ðŸ‘¤';
      default: return 'ðŸ”';
    }
  };

  const toggleRealTime = () => {
    setRealTimeEnabled(!realTimeEnabled);
  };

  // Calculate summary statistics
  const calculateStats = () => {
    const totalLogs = logs.length;
    const successCount = logs.filter(log => log.RESULT?.toLowerCase() === 'success').length;
    const failureCount = logs.filter(log => log.RESULT?.toLowerCase() === 'failure').length;
    const recentLogs = logs.filter(log => {
      const logTime = new Date(log.TIMESTAMP);
      const oneHourAgo = new Date(Date.now() - 60 * 60 * 1000);
      return logTime > oneHourAgo;
    }).length;

    return {
      total: totalLogs,
      success: successCount,
      failure: failureCount,
      recent: recentLogs,
      successRate: totalLogs > 0 ? ((successCount / totalLogs) * 100).toFixed(1) : 0
    };
  };

  const stats = calculateStats();

  return (
    <div className="space-y-6">
      {/* Header */}
      <div className="flex justify-between items-center">
        <div>
          <h1 className="text-2xl font-bold text-gray-900">Access Logs</h1>
          <p className="text-gray-600">Monitor system access and security events</p>
        </div>
        <div className="flex space-x-3">
          <button
            onClick={toggleRealTime}
            className={`btn flex items-center space-x-2 ${
              realTimeEnabled ? 'btn-primary' : 'btn-secondary'
            }`}
          >
            <span>{realTimeEnabled ? 'â¸ï¸' : 'â–¶ï¸'}</span>
            <span>{realTimeEnabled ? 'Stop Monitoring' : 'Real-time Monitoring'}</span>
          </button>
          <button
            onClick={fetchLogs}
            className="btn btn-secondary flex items-center space-x-2"
          >
            <span>ðŸ”„</span>
            <span>Refresh</span>
          </button>
        </div>
      </div>

      {/* Real-time Status */}
      {realTimeEnabled && (
        <div className="bg-blue-50 border border-blue-200 rounded-lg p-4">
          <div className="flex items-center">
            <div className="animate-pulse h-3 w-3 bg-blue-600 rounded-full mr-3"></div>
            <p className="text-blue-800">Real-time monitoring active - Auto-refreshing every 10 seconds</p>
          </div>
        </div>
      )}

      {/* Statistics Cards */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-5 gap-4">
        <div className="bg-white p-6 rounded-lg shadow border">
          <div className="flex items-center">
            <div className="p-2 bg-blue-100 rounded-lg">
              <span className="text-2xl">ðŸ“Š</span>
            </div>
            <div className="ml-4">
              <p className="text-sm font-medium text-gray-600">Total Events</p>
              <p className="text-2xl font-bold text-gray-900">{stats.total}</p>
            </div>
          </div>
        </div>

        <div className="bg-white p-6 rounded-lg shadow border">
          <div className="flex items-center">
            <div className="p-2 bg-green-100 rounded-lg">
              <span className="text-2xl">âœ…</span>
            </div>
            <div className="ml-4">
              <p className="text-sm font-medium text-gray-600">Successful</p>
              <p className="text-2xl font-bold text-green-600">{stats.success}</p>
            </div>
          </div>
        </div>

        <div className="bg-white p-6 rounded-lg shadow border">
          <div className="flex items-center">
            <div className="p-2 bg-red-100 rounded-lg">
              <span className="text-2xl">âŒ</span>
            </div>
            <div className="ml-4">
              <p className="text-sm font-medium text-gray-600">Failed</p>
              <p className="text-2xl font-bold text-red-600">{stats.failure}</p>
            </div>
          </div>
        </div>

        <div className="bg-white p-6 rounded-lg shadow border">
          <div className="flex items-center">
            <div className="p-2 bg-yellow-100 rounded-lg">
              <span className="text-2xl">â°</span>
            </div>
            <div className="ml-4">
              <p className="text-sm font-medium text-gray-600">Recent (1h)</p>
              <p className="text-2xl font-bold text-yellow-600">{stats.recent}</p>
            </div>
          </div>
        </div>

        <div className="bg-white p-6 rounded-lg shadow border">
          <div className="flex items-center">
            <div className="p-2 bg-purple-100 rounded-lg">
              <span className="text-2xl">ðŸ“ˆ</span>
            </div>
            <div className="ml-4">
              <p className="text-sm font-medium text-gray-600">Success Rate</p>
              <p className="text-2xl font-bold text-purple-600">{stats.successRate}%</p>
            </div>
          </div>
        </div>
      </div>

      {/* Filters */}
      <div className="card">
        <div className="p-6">
          <h3 className="text-lg font-medium text-gray-900 mb-4">Filters</h3>
          
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
            <div>
              <label className="block text-sm font-medium text-gray-700 mb-1">Search</label>
              <input
                type="text"
                value={filters.search}
                onChange={(e) => handleFilterChange('search', e.target.value)}
                placeholder="Search users, rooms, access types..."
                className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
              />
            </div>

            <div>
              <label className="block text-sm font-medium text-gray-700 mb-1">Access Type</label>
              <select
                value={filters.accesstype}
                onChange={(e) => handleFilterChange('accesstype', e.target.value)}
                className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
              >
                <option value="">All Types</option>
                <option value="entry">Entry</option>
                <option value="exit">Exit</option>
                <option value="door_unlock">Door Unlock</option>
                <option value="door_lock">Door Lock</option>
                <option value="session_start">Session Start</option>
                <option value="session_end">Session End</option>
                <option value="emergency">Emergency</option>
                <option value="maintenance">Maintenance</option>
                <option value="admin_override">Admin Override</option>
              </select>
            </div>

            <div>
              <label className="block text-sm font-medium text-gray-700 mb-1">Result</label>
              <select
                value={filters.result}
                onChange={(e) => handleFilterChange('result', e.target.value)}
                className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
              >
                <option value="">All Results</option>
                <option value="success">Success</option>
                <option value="failure">Failure</option>
                <option value="denied">Denied</option>
                <option value="warning">Warning</option>
              </select>
            </div>

            <div>
              <label className="block text-sm font-medium text-gray-700 mb-1">Room</label>
              <select
                value={filters.room_id}
                onChange={(e) => handleFilterChange('room_id', e.target.value)}
                className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
              >
                <option value="">All Rooms</option>
                {rooms.map(room => (
                  <option key={room.ROOMID} value={room.ROOMID}>
                    {room.ROOMNUMBER} - {room.ROOMNAME}
                  </option>
                ))}
              </select>
            </div>

            <div>
              <label className="block text-sm font-medium text-gray-700 mb-1">Start Date</label>
              <input
                type="date"
                value={filters.start_date}
                onChange={(e) => handleFilterChange('start_date', e.target.value)}
                className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
              />
            </div>

            <div>
              <label className="block text-sm font-medium text-gray-700 mb-1">End Date</label>
              <input
                type="date"
                value={filters.end_date}
                onChange={(e) => handleFilterChange('end_date', e.target.value)}
                className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
              />
            </div>
          </div>

          <div className="mt-4 flex space-x-3">
            <button onClick={clearFilters} className="btn btn-secondary">
              Clear Filters
            </button>
          </div>
        </div>
      </div>

      {/* Access Logs Table */}
      <div className="card">
        <div className="p-6">
          <div className="flex justify-between items-center mb-4">
            <h3 className="text-lg font-medium text-gray-900">
              Access Events ({pagination.total?.toLocaleString()})
            </h3>
          </div>

          {loading ? (
            <div className="text-center py-12">
              <div className="inline-block animate-spin rounded-full h-8 w-8 border-b-2 border-blue-600"></div>
              <p className="mt-2 text-gray-600">Loading access logs...</p>
            </div>
          ) : logs.length === 0 ? (
            <div className="text-center py-12">
              <span className="text-6xl mb-4 block">ðŸ”</span>
              <h3 className="text-lg font-medium text-gray-900 mb-2">No access logs found</h3>
              <p className="text-gray-500">Try adjusting your filters or check back later.</p>
            </div>
          ) : (
            <div className="overflow-x-auto">
              <table className="min-w-full divide-y divide-gray-200">
                <thead className="bg-gray-50">
                  <tr>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      Timestamp
                    </th>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      User
                    </th>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      Access Type
                    </th>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      Room
                    </th>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      Result
                    </th>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      Auth Method
                    </th>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      Reason
                    </th>
                  </tr>
                </thead>
                <tbody className="bg-white divide-y divide-gray-200">
                  {logs.map((log) => (
                    <tr key={log.LOGID} className="hover:bg-gray-50">
                      <td className="px-6 py-4 whitespace-nowrap">
                        <div className="text-sm text-gray-900">
                          {formatDateTime(log.TIMESTAMP)}
                        </div>
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap">
                        {log.FIRSTNAME ? (
                          <div className="flex items-center">
                            <div className="h-8 w-8 rounded-full bg-gray-300 flex items-center justify-center">
                              <span className="text-xs font-medium text-gray-700">
                                {log.FIRSTNAME?.[0]}{log.LASTNAME?.[0]}
                              </span>
                            </div>
                            <div className="ml-3">
                              <div className="text-sm font-medium text-gray-900">
                                {log.FIRSTNAME} {log.LASTNAME}
                              </div>
                              <div className="text-sm text-gray-500">
                                {log.STUDENTID || log.EMPLOYEEID}
                              </div>
                            </div>
                          </div>
                        ) : (
                          <span className="text-sm text-gray-500 italic">System/Unknown</span>
                        )}
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap">
                        <div className="flex items-center">
                          <span className="mr-2">{getAccessTypeIcon(log.ACCESSTYPE)}</span>
                          <span className="text-sm text-gray-900 capitalize">
                            {log.ACCESSTYPE?.replace('_', ' ')}
                          </span>
                        </div>
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap">
                        <div className="text-sm text-gray-900">
                          {log.ROOMNUMBER || 'N/A'}
                        </div>
                        {log.ROOMNAME && (
                          <div className="text-sm text-gray-500">
                            {log.ROOMNAME}
                          </div>
                        )}
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap">
                        <span className={`inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium ${getResultColor(log.RESULT)}`}>
                          {log.RESULT}
                        </span>
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap">
                        <div className="flex items-center">
                          <span className="mr-2">{getAuthMethodIcon(log.AUTHMETHOD)}</span>
                          <span className="text-sm text-gray-900">{log.AUTHMETHOD}</span>
                        </div>
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap">
                        <div className="text-sm text-gray-900 max-w-xs truncate">
                          {log.REASON || 'N/A'}
                        </div>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          )}

          {/* Pagination */}
          {pagination.pages > 1 && (
            <div className="mt-6 flex items-center justify-between">
              <div className="text-sm text-gray-500">
                Showing {((pagination.page - 1) * pagination.limit) + 1} to {Math.min(pagination.page * pagination.limit, pagination.total)} of {pagination.total} results
              </div>
              <div className="flex space-x-2">
                <button
                  onClick={() => handlePageChange(pagination.page - 1)}
                  disabled={pagination.page === 1}
                  className="px-3 py-2 border border-gray-300 rounded-md text-sm font-medium text-gray-700 bg-white hover:bg-gray-50 disabled:opacity-50 disabled:cursor-not-allowed"
                >
                  Previous
                </button>
                
                {Array.from({ length: Math.min(5, pagination.pages) }, (_, i) => {
                  const pageNum = Math.max(1, Math.min(pagination.page - 2 + i, pagination.pages - 4 + i + 1));
                  return (
                    <button
                      key={pageNum}
                      onClick={() => handlePageChange(pageNum)}
                      className={`px-3 py-2 border rounded-md text-sm font-medium ${
                        pageNum === pagination.page
                          ? 'bg-blue-600 border-blue-600 text-white'
                          : 'border-gray-300 text-gray-700 bg-white hover:bg-gray-50'
                      }`}
                    >
                      {pageNum}
                    </button>
                  );
                })}
                
                <button
                  onClick={() => handlePageChange(pagination.page + 1)}
                  disabled={pagination.page === pagination.pages}
                  className="px-3 py-2 border border-gray-300 rounded-md text-sm font-medium text-gray-700 bg-white hover:bg-gray-50 disabled:opacity-50 disabled:cursor-not-allowed"
                >
                  Next
                </button>
              </div>
            </div>
          )}
        </div>
      </div>
    </div>
  );
}

export default AccessLogs;
